import { Routes, Route, Link } from 'react-router-dom';


function AdminDashboard () {
    const params = useParams()
    const page = params.page
    return(
        <>
        <Routes>
        <Route path="*" element={<Notfoundpage />} />
        </Routes>
        adminDashboardasd
        {page == 'items' ? (<>Items</>) : (<></>)}
        </>
    )
}

